<p>One of the key challenges in this model is omitted-variable bias. For instance, firm size is often correlated with both a managers innate abilities and firm-specific policies. By introducing fixed effects for both managers and firms, they are able to control for these time-invariant factors, ensuring that the estimates of the model parameters are consistent and unbiased.</p>
