<p>The AKM method is a more sophisticated approach. It uses group connection, where they connect managers and firms that have had any overlap, even if the manager has never moved. This allows for the separation of fixed effects for both movers and non-movers, expanding the sample size and increasing the precision of their estimates. The method is especially useful when mobility is limited, as it compensates for this by connecting firms and managers across different groupings.</p>
